import React from 'react'

const Comments = (props) => {

	return(
		<div className="ui segment">

			<div className="ui relaxed divided list">

				<div class="item">
					<div class="content">
        				<div class="header" color="green"> Andre </div>
        				Hi
      				</div>

				</div>
			</div>
		</div>
	);
}

export default Comments;
